import React from 'react'
import ArtworchLight from '../../../assets/img/logo_light.svg'
import {Link} from "react-router-dom";
import IconButton from "@material-ui/core/IconButton";

function Logo(props) {

    return (
        <IconButton component={Link} to="/" color='inherit' style={{marginRight: '4px',}} disableRipple={true}>
            {
                <img src={ArtworchLight} width={32} height={32} alt='artworch'/>
            }
        </IconButton>
    )
}

export default Logo
